let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let z = fst x + snd x in 
        match a with
          | (w,y) -> (((w+z)/10), ((w+z) mod 10)::y)
    in 
    let base = (0,[]) in
    let args =  List.rev(List.combine l1 l2) @ [(0,0)] in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero(add (padZero l1 l2))

