let rec mulByTen n = match n with
  | 0 -> 0
  | 1 -> 10
  | _ -> 10 * (mulByTen (n-1))

let bigMul l1 l2 = 
  let f a x =  
    let (la, lb) = x in
    let (i, acc) = a in
      match l1 with
        | [] -> (i, acc)
        | h::t -> let temp = mulByDigit h lb 
            in (i + 1, ( bigAdd acc (temp * (mulByTen i))))
let base = (0, []) in
let args = (List.rev l1 , List.rev l2) in
let (_, res) = List.fold_left f base args in
  res

